function getPageName(url) {
  var index = url.split("/", 3).join("/").length + 1;
  var filenameWithExtension = url.substr(index);
  var filename = filenameWithExtension.split(".")[0];
  return filename;
}
function getCategoryName(url) {
  var splitted = url.split("/");
  var name = splitted[1];
  return name;
}

